import React from "react";

const Login = () => {
    return (
      <div className="App">
        <h1>Paralelo 19</h1>
        <div className='infos'>
          <div className='campoEmail'>
          <h2>Email:</h2>
          <input placeholder='Digite aqui...'></input>
          </div>
          <div className='campoSenha'>
          <h2>Senha:</h2>
          <input placeholder='Digite aqui...'></input>
          </div>
          
        </div>
      </div>
    );
  }
